import './App.css';
import uuid from 'react-uuid'
import React, { useState } from 'react';

function App() {

	const [valueOne, setValueOne] = useState(" ");
    const [valueTwo, setValueTwo] = useState(" ");

    function onChangeOne (event) {
        setValueOne(event.target.value);
    }

    function onChangeTwo (event) {
        setValueTwo(event.target.value);
    }

    return <div>
        <input value = {valueOne} onChange = {onChangeOne}/>
        <input value = {valueTwo} onChange = {onChangeTwo}/>
        <p>{valueOne}</p>
        <p>{valueTwo}</p>
    </div>
}

export default App;
